


/* Part 1 */
DROP TABLE IF EXISTS Passengers
DROP TABLE IF EXISTS Bookings
DROP TABLE IF EXISTS Flights
DROP TABLE IF EXISTS Payments
DROP TABLE IF EXISTS Airports
DROP TABLE IF EXISTS Airlines
GO

/* Part 2 */
CREATE TABLE [Airlines] (
    [AirlineCode]     char(3)
        CONSTRAINT PK_Airlines_AirlineCode
            PRIMARY KEY               NOT NULL,
    [Name]            nvarchar(85)  NOT NULL
);

CREATE TABLE [Airports] (
    [AirportCode]         int
        CONSTRAINT PK_Airports_AirportCode
            PRIMARY KEY
        IDENTITY(1000,1)                NOT NULL,
    [Name]                nvarchar(90)  NOT NULL,
    [City]                nvarchar(35)  NOT NULL,
    [Country]             nvarchar(35)  NOT NULL,
    [IATA]                char(3)           NULL,
    [ICAO]                char(4)           NULL,
    [Latitude]            decimal(12,9) NOT NULL,
    [Longitude]           decimal(12,9) NOT NULL, 
    [Altitude]            int           NOT NULL,
    [TimeZone]            decimal       NOT NULL,
    [TzDatabaseTimeZone]  nvarchar(50)  NOT NULL
);

CREATE TABLE [Payments] (
    [ConfirmationNumber]  uniqueidentifier
        CONSTRAINT PK_Payments_ConfirmationNumber
            PRIMARY KEY                 NOT NULL,
    [Timestamp]           datetime
        CONSTRAINT DF_Payments_Timestamp
            DEFAULT (GETDATE())         NOT NULL,
    [Amount]              money
        CONSTRAINT CK_Payments_Amount
            CHECK (Amount > 0)          NOT NULL,
    [PaymentType]         varchar(10)   NOT NULL
);

CREATE TABLE [Flights] (
    [FlightCode]          varchar(18)
        CONSTRAINT PK_Flights_FlightCode
            PRIMARY KEY                 NOT NULL,
    [FlightNumber]        varchar(8)    NOT NULL,
    [Date]                date          NOT NULL,
    [DepartureAirport]    int
        CONSTRAINT FK_Flights_Departures
        FOREIGN KEY REFERENCES Airports(AirportCode)
                                        NOT NULL,
    [Departure]           time          NOT NULL,
    [ArrivalAirport]      int
        CONSTRAINT FK_Flights_Arrivals
        FOREIGN KEY REFERENCES Airports(AirportCode)
                                        NOT NULL,
    [Arrival]             datetime      NOT NULL,
    [FlightDuration]      time          NOT NULL,
    [Cancelled]           bit           NOT NULL,
    [IsFull]              bit
        CONSTRAINT DF_Flights_IsFull  DEFAULT (0)
                                        NOT NULL,
    [AirlineCode]         char(3)
        CONSTRAINT FK_Flights_Airlines
        FOREIGN KEY REFERENCES Airlines(AirlineCode)
                                        NOT NULL,
    CONSTRAINT CK_Flights_DepartureAirPort_ArrivalAirport
        CHECK  ([DepartureAirport] <> [ArrivalAirport])
);

CREATE TABLE [Bookings] (
    [ConfirmationNumber]        char(11)
        CONSTRAINT PK_Bookings_ConfirmationNumber
            PRIMARY KEY                             NOT NULL,
    [FlightCode]                varchar(18)
        CONSTRAINT FK_Bookings_Flights
        FOREIGN KEY REFERENCES Flights(FlightCode)
                                                    NOT NULL,
    [PaymentConfirmationNumber] uniqueidentifier  
        CONSTRAINT FK_Bookings_Payments
        FOREIGN KEY REFERENCES Payments(ConfirmationNumber)
                                                        NULL,
    [FirstName]                 nvarchar(40)      NOT NULL,
    [MiddleName]                nvarchar(40)          NULL,
    [LastName]                  nvarchar(40)      NOT NULL,
    [PhoneNumber]               char(14)
        CONSTRAINT CK_Bookings_PhoneNumber
        CHECK (PhoneNumber LIKE
                '[0-9]-[0-9][0-9][0-9]-[0-9][0-9][0-9]-[0-9][0-9][0-9][0-9]')
                                                    NOT NULL,
    [AlternatePhoneNumber] [char](14)
        CONSTRAINT CK_Bookings_AlternatePhoneNumber
        CHECK (AlternatePhoneNumber LIKE
                '[0-9]-[0-9][0-9][0-9]-[0-9][0-9][0-9]-[0-9][0-9][0-9][0-9]')
                                                        NULL,
    [EmailAddress]              nvarchar(50)      NOT NULL,
    [StreetAddress]             nvarchar(50)      NOT NULL,
    [City]                      nvarchar(40)      NOT NULL,
    [Region]                    nvarchar(25)          NULL,
    [Country]                   nvarchar(35)      NOT NULL
);

CREATE TABLE [Passengers](
    [ConfirmationNumber]    char(11)
        CONSTRAINT FK_Passengers_Bookings
        FOREIGN KEY REFERENCES Bookings(ConfirmationNumber)
                                            NOT NULL,
    [CustomerId]            int             NOT NULL,
    [FirstName]             nvarchar(40)    NOT NULL,
    [MiddleName]            nvarchar(40)        NULL,
    [LastName]              nvarchar(40)    NOT NULL,
    [DateOfBirth]           date            NOT NULL,
    [PhoneNumber]           char(14)
        CONSTRAINT CK_Passengers_PhoneNumber
        CHECK (PhoneNumber LIKE
                '[0-9]-[0-9][0-9][0-9]-[0-9][0-9][0-9]-[0-9][0-9][0-9][0-9]')
                                                NULL,
    CONSTRAINT PK_Passengers_ConfirmationNumber_CustomerId 
        PRIMARY KEY ([ConfirmationNumber], [CustomerId])
);

GO

ALTER TABLE Passengers
    ADD AgeGroup  varchar(8)
        CONSTRAINT CK_Passengers_AgeGroup
        CHECK   (AgeGroup IN ('Child', 'Adult', 'Senior')),
        CONSTRAINT DF_Passengers_AgeGroup
        DEFAULT ('Adult') FOR AgeGroup

ALTER TABLE Flights
    ADD CONSTRAINT DF_Flights_Cancelled
        DEFAULT (0) FOR Cancelled
GO

ALTER TABLE Payments
    ADD CONSTRAINT CK_Payments_PaymentType
        CHECK   (PaymentType IN ('CREDIT','PayPal','BitCoin'))

CREATE NONCLUSTERED INDEX IX_Flights_DepartureAirport ON  Flights(DepartureAirport)
CREATE NONCLUSTERED INDEX IX_Flights_ArrivalAirport ON  Flights(ArrivalAirport)
CREATE NONCLUSTERED INDEX IX_Flights_AirlineCode ON  Flights(AirlineCode)
CREATE NONCLUSTERED INDEX IX_Bookings_FlightCode ON  Bookings(FlightCode)
CREATE NONCLUSTERED INDEX IX_Bookings_PaymentConfirmationNumber ON  Bookings(PaymentConfirmationNumber)
CREATE NONCLUSTERED INDEX IX_Passengers_ConfirmationNumber ON  Passengers(ConfirmationNumber)

GO


